import React, { Component } from 'react'


export class Helpus extends Component {
    render() {
        return (
            <React.Fragment>
                <img className="image_wrapper" src="/images/image2.png"/>
                <div className="image_wrapper" >
                </div>
                <div className="image_left_wrapper">
                </div>
                <div className="image_left_head">
                We Help You Grow Your  Business
                </div>
                <div className="image_left_head_bottom">
                Why are we in business?
                </div>
                <div className="image_left_text">
               <p> At Spineor, we think the website or mobile<br/>
                 application of your company is your brand and<br/>
                  your brand is vital for the results of your company.<br/>
                   Your website  app is a showcase of your <br/>
                   company to your clients, whether you're looking to <br/>
                    enter eCommerce, want to offer your restaurant<br/>
                     some additional panache on the internet, or have<br/>
                      the next excellent mobile app concept.</p>
                       <p>
                      Building websites and mobile apps is our passion.<br/>
                       Helping people to grow their businesses is our<br/>
                        dream.</p>
                </div>
                <div className="first_button">
                <div className="first_button_wrapper">
                
                </div>
                <div className="first_button_inner">
                Delivery on Time 
                </div>
                </div>
                <div className="second_button">
                <div className="second_button_wrapper">
                
                </div>
                <div className="second_button_inner">
                Clear Communications 
                </div>
                </div>
                <div className="third_button">
                <div className="third_button_wrapper">
                
                </div>
                <div className="third_button_inner">
                    Upfront
                </div>
                </div>
                <div className="fourth_button">
                <div className="fourth_button_wrapper">
                </div>
                <div className="fourth_button_inner">
                    Innovative
                </div>
                </div>
                <div className="fifth_button_wrapper">
                </div>
                <div className="fifth_button_inner">
                    Reliability
                </div>
                <div className="line8">
                </div>
                <div className="line3">
                </div>
                <div className="line7">  
                </div>
                <div className="line10">
                </div>
                <div className="line9">
                </div>
               
                <div className="line13">
                    
                </div>
                
                
                <div className="testing">
                Testing & Launch 
                </div>
                <div className="maintain">
                MAINTENANCE & ONGOING SUPPORT 
                </div>
                <div className="strategy">
                STRATEGY
                </div>
                <div className="design">
                DESIGN
                </div>
                <div className="content">
                CONTENT CREATION
                </div>
                <div className="devop">
                DEVELOPMENT
                </div>
               
                
                <style jsx>{`
              
                .image_wrapper{
                    position: absolute;
                    width: 1299px;
                    height: 996px;
                    left: 1px;
                    top: 2918px;
                    background-image: url('../resourses/images/img1.jpg');
                    background-color:'grey';
                    transform: matrix(-1, 0, 0, 1, 0, 0);
                }
                .image_left_wrapper{
                    position: absolute;
                    width: 617px;
                    height: 806px;
                    left: 34px;
                    top: 3140px;
                    background: #184A88;
                }
                .image_left_head{
                    position: absolute;
                    width: 541px;
                    height: 110px;
                    left: 68px;
                    top: 3206px;
                    font-family: Roboto;
                    font-style: normal;
                    font-weight: normal;
                    font-size: 48px;
                    line-height: 56px;
                    color: rgba(255, 255, 255, 0.9);
                }
                .image_left_head_bottom{
                    position: absolute;
                    width: 200px;
                    height: 21px;
                    left: 74px;
                    top: 3333px;
                    font-family: Roboto;
                    font-style: normal;
                    font-weight: 900;
                    font-size: 18px;
                    line-height: 21px;
                    color: #FFFFFF;
                }
                .image_left_text{
                    position: absolute;
                    width: 525.23px;
                    height: 308.1px;
                    left: 68px;
                    top: 3395px;
                    font-family: Roboto;
                    font-style: normal;
                    font-weight: 300;
                    font-size: 24px;
                    line-height: 28px;
                    color: #FFFFFF;
                }
                .first_button_wrapper{
                    position: absolute;
                    width: 181px;
                    height: 42px;
                    left: 64px;
                    top: 3771px;

                    background: #87BBE5;
                    border: 1px solid #184A88;
                    box-sizing: border-box;
                    border-radius: 33px;
                }
                .first_button_inner{
                    position: absolute;
                    width: 118px;
                    height: 19px;
                    left: 96px;
                    top: 3783px;
                    font-family: Roboto;
                    font-style: normal;
                    font-weight: normal;
                    font-size: 16px;
                    line-height: 19px;
                    color: #184A88;

                }
                .second_button_wrapper{
                    position: absolute;
                    width: 226px;
                    height: 42px;
                    left: 264px;
                    top: 3771px;
                    background: #87BBE5;
                    border: 1px solid #184A88;
                    box-sizing: border-box;
                    border-radius: 33px;
                }
                .second_button_inner{
                    position: absolute;
                    width: 163px;
                    height: 19px;
                    left: 296px;
                    top: 3783px;
                    font-family: Roboto;
                    font-style: normal;
                    font-weight: normal;
                    font-size: 16px;
                    line-height: 19px;
                    color: #184A88;
                }
                .third_button_wrapper{
                    position: absolute;
                    width: 118px;
                    height: 42px;
                    left: 64px;
                    top: 3823px;
                    background: #87BBE5;
                    border: 1px solid #184A88;
                    box-sizing: border-box;
                    border-radius: 33px;
                }
                .third_button_inner{
                    position: absolute;
                    width: 54px;
                    height: 19px;
